    const history = useHistory()

    const [form, setForm] = useState({
        text: '',
        title: ''
    })

    const changeHandler = e => {
        setForm({...form, [e.target.name]: e.target.value})
    }

    return (
        <div className="auth">

        </div>
    )
}
